DROP TABLE IF EXISTS `sys_same_client`;
CREATE TABLE `sys_same_client` (
  `USER_IP` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户IP',
  `AUDIT_COUNT` decimal(8,0) NOT NULL COMMENT '登陆失败审计计数',
  `LOCK_TIME` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`USER_IP`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='同一IP登录审计表';

