-- ----------------------------
-- Table structure for sys_staff_audit
-- ----------------------------
DROP TABLE IF EXISTS `sys_staff_audit`;
CREATE TABLE `sys_staff_audit` (
  `STAFF_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '人员表主键',
  `STRU_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '人员对应的组织结构id（注：不是所属）',
  `NAME` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '姓名',
  `SEX` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '性别',
  `BIRTHDAY` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '出生日期',
  `IDCARD` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '身份证号',
  `ADDRESS` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '家庭住址',
  `WORK_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '工号',
  `WORK_DATE` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '入职日期',
  `GRADUATE_SCHOOL` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '毕业院校',
  `GRADUATE_DATE` varchar(16) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '毕业日期',
  `REAL_STAFF_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '关联SYS_STAFF表STAFF_ID',
  PRIMARY KEY (`STAFF_ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='职工审核表';

-- ----------------------------
-- Records of sys_staff_audit
-- ----------------------------

-- ----------------------------
-- Table structure for sys_stru
-- ----------------------------
DROP TABLE IF EXISTS `sys_stru`;
CREATE TABLE `sys_stru` (
  `STRU_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '结构编码',
