  `USER_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户编码',
  `USER_NAME` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户名称',
  `PASSWORD` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '密码',
  `ACCOUNT_STATUS` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '账户状态 0：锁定 1：激活 2：删除 3：休眠',
  `SECURITY_LEVEL` decimal(8,0) DEFAULT NULL COMMENT '安全级别',
  `MAX_SESSIONS` decimal(8,0) NOT NULL COMMENT '允许创建的最大会话数',
  `IS_SYS` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '是否系统管理员',
  `IS_CPUBLIC` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否公司级公用账号',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `LOCK_TIME` datetime DEFAULT NULL COMMENT '锁定时间',
  `EXPIRED_TIME` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '失效时间',
  `PSWD_UPT_TIME` datetime DEFAULT NULL COMMENT '上次密码修改时间',
  `PSWD_TIME` datetime DEFAULT NULL COMMENT '密码失效时间',
  `CORPORATION_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '公司结构编码',
  `DEPARTMENT_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '部门结构编码',
  `EMPLOYEE_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '员工结构编码',
  `E_MAIL` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '电子邮件',
  `WECHAT` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '微信',
  `TELEPHONE` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '电话',
  `MOBILE` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '移动电话',
  `CHAR_1` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '字符型扩充字段1',
  `CHAR_2` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '字符型扩充字段2',
  `NUM_1` decimal(8,0) DEFAULT NULL COMMENT '数字型扩充字段1',
  `NUM_2` decimal(8,0) DEFAULT NULL COMMENT '数字型扩充字段2',
  `PERMISSION_STRU_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '权限组织结构编码',
  `USER_ORDER` decimal(8,0) DEFAULT NULL COMMENT '用户排序序号',
  `PROVINCE_CODE` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '行政区代码',
  `USER_ACCOUNT` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `TYPE_PROPERTY` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '类型属性 0 临时账号 1长期账号',
  `START_TIME` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '开始时间 ',
  `LAST_LOGIN_TIME` datetime DEFAULT NULL COMMENT '最后登录时间',
  `ACCESS_LOGIN_START_TIME` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '允许登录时间',
  `ACCESS_LOGIN_END_TIME` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '允许登录时间',
  `TOTP_KEY` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '身份验证',
  `LOGIN_TIME_LIMIT` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否开启登录时间验证，1 开启 0不开启',
  `LOGIN_IP_LIMIT` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否开启登录IP验证，1 开启 0不开启',
  `IS_AUDIT` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '是否已经审核',
  `CURRENT_STATUS` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '当前状态0：新增；1：修改；2：删除；',
  `ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='用户审核表';

