-- ----------------------------
-- View structure for v_emp_info
-- ----------------------------
DROP VIEW IF EXISTS `v_emp_info`;
CREATE ALGORITHM=UNDEFINED  SQL SECURITY DEFINER VIEW `v_emp_info` AS select `st`.`STRU_ID` AS `EMPLOYEE_ID`,`so`.`ORGAN_NAME` AS `EMPLOYEE_NAME`,`st`.`STAFF_POSITION` AS `STAFF_POSITION`,`st`.`IN_USE` AS `IN_USE`,`ss`.`staff_id` AS `staff_id`,`ss`.`stru_id` AS `stru_id`,`ss`.`name` AS `name`,`ss`.`birthday` AS `birthday`,`ss`.`sex` AS `sex`,`ss`.`idcard` AS `idcard`,`ss`.`address` AS `address`,`ss`.`work_id` AS `work_id`,`ss`.`work_date` AS `work_date`,`ss`.`graduate_school` AS `graduate_school`,`ss`.`graduate_date` AS `graduate_date` from ((`sys_stru` `st` left join `sys_organ` `so` on((`st`.`ORGAN_ID` = `so`.`ORGAN_ID`))) left join `sys_staff` `ss` on((`st`.`STRU_ID` = `ss`.`stru_id`))) where (`st`.`STRU_TYPE` = '9') order by `st`.`STRU_LEVEL`,`st`.`STRU_ORDER`,`st`.`GLOBAL_ORDER` ;

-- ----------------------------
-- View structure for v_organ_info
-- ----------------------------
DROP VIEW IF EXISTS `v_organ_info`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `v_organ_info` AS select `sof`.`OFFICE_ID` AS `OFFICE_ID`,`sof`.`STRU_ID` AS `STRU_ID`,`sof`.`OFFICE_ALIAS` AS `OFFICE_ALIAS`,`sof`.`OFFICE_ADDRESS` AS `OFFICE_ADDRESS`,`st`.`ORGAN_ID` AS `ORGAN_ID`,`so`.`ORGAN_NAME` AS `ORGAN_NAME`,`so`.`SHORT_NAME` AS `SHORT_NAME`,`st`.`ORGAN_ALIAS` AS `ORGAN_ALIAS`,`st`.`STRU_TYPE` AS `STRU_TYPE`,`sot`.`TYPE_NAME` AS `TYPE_NAME`,`st`.`PARENT_ID` AS `PARENT_ID`,`st`.`PRINCIPAL_ID` AS `PRINCIPAL_ID`,`st`.`IN_USE` AS `IN_USE` from (((`sys_stru` `st` left join `sys_organ` `so` on((`st`.`ORGAN_ID` = `so`.`ORGAN_ID`))) left join `sys_organ_type` `sot` on((`st`.`STRU_TYPE` = `sot`.`ORGAN_TYPE`))) left join `sys_office` `sof` on((`st`.`STRU_ID` = `sof`.`STRU_ID`))) where (`st`.`STRU_TYPE` <> '9') order by `st`.`STRU_LEVEL`,`st`.`STRU_ORDER`,`st`.`GLOBAL_ORDER` ;

-- ----------------------------
-- View structure for v_user_info
-- ----------------------------
DROP VIEW IF EXISTS `v_user_info`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `v_user_info` AS select `su`.`USER_ID` AS `USER_ID`,`su`.`USER_NAME` AS `USER_NAME`,`su`.`EMPLOYEE_ID` AS `EMPLOYEE_ID`,`su`.`DEPARTMENT_ID` AS `DEPARTMENT_ID`,`emp`.`ORGAN_ALIAS` AS `EMP_NAME`,`su`.`USER_ACCOUNT` AS `USER_ACCOUNT`,`st`.`IN_USE` AS `IN_USE`,`su`.`ACCOUNT_STATUS` AS `ACCOUNT_STATUS`,`su`.`IS_SYS` AS `IS_SYS` from ((`sys_users` `su` left join `sys_stru` `st` on((convert(`su`.`DEPARTMENT_ID` using utf8mb4) = convert(`st`.`STRU_ID` using utf8mb4)))) left join `sys_stru` `emp` on((convert(`su`.`EMPLOYEE_ID` using utf8mb4) = convert(`emp`.`STRU_ID` using utf8mb4)))) ;
